import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import styles from '../cssPage/potfolio.module.css';



function NavBar() {
  return (
    <Navbar expand="lg" style={{opacity:0.0}}>
      <Container >
        <h4 className={'p-3'}>JS Full-stack Developer</h4>
        <div>

        
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home" className={styles.tagline}>About Me</Nav.Link>
            <Nav.Link href="#link" className={styles.tagline}>Projects</Nav.Link>
            <NavDropdown className={styles.tagline} title="More" id="basic-nav-dropdown" >
              <NavDropdown.Item href="#action/3.1" className={styles.tagline}>Contact</NavDropdown.Item>
              <NavDropdown.Item className={styles.tagline} href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3" className={styles.tagline}>Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item className={styles.tagline} href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
        </div>
      </Container>
    </Navbar>
  );
}

export default NavBar;
